# Given a string, find the length of the longest substring without repeating characters.

# Example 1:

# Input: "abcabcbb"
# Output: 3
# Explanation: The answer is "abc", with the length of 3.
# Example 2:

# Input: "bbbbb"
# Output: 1
# Explanation: The answer is "b", with the length of 1.
# Example 3:

# Input: "pwwkew"
# Output: 3
# Explanation: The answer is "wke", with the length of 3.
#              Note that the answer must be a substring, "pwke" is a subsequence and not a substring.

# @param {String} s
# @return {Integer}
def length_of_longest_substring(s)
  return 0 if s.size.zero?

  substrings = []

  s.chars.size.times do |i|
    substrings[i] = []
    chars = s.chars.drop(i).reverse
    current_char = chars.pop
    until current_char.nil? || substrings[i].count(current_char) == 1
      substrings[i] << current_char
      current_char = chars.pop
    end
  end

  substrings.map(&:size).max
end

